import React, { useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, useNavigate } from 'react-router-dom';
import Pricing from './pages/Pricing';
import Error from './pages/Error';

function LandingPage() {
  const navigate = useNavigate();

  useEffect(() => {
    // Load Tally form embeds when component mounts
    if (window.Tally) {
      window.Tally.loadEmbeds();
    }

    // Setup form submission tracking
    const handleTallySubmit = () => {
      if (window.gtag) {
        window.gtag('event', 'form_submission', {
          'event_category': 'engagement',
          'event_label': 'signup_form'
        });
        window.gtag_report_conversion();
      }
      // Navigate to pricing page after form submission
      navigate('/pricing');
    };

    // Listen for Tally form submission
    window.addEventListener('tally-form:submit', handleTallySubmit);

    return () => {
      window.removeEventListener('tally-form:submit', handleTallySubmit);
    };
  }, [navigate]);

  return (
    <div className="bg-white">
      <header className="absolute inset-x-0 top-0 z-50">
        <nav className="flex items-center justify-center p-6 lg:px-8" aria-label="Global">
          <div className="flex">
            <a href="/" className="-m-1.5 p-1.5">
              <span className="text-2xl font-bold text-black">üè• Medical Provider Leads</span>
            </a>
          </div>
        </nav>
      </header>

      <div className="relative isolate px-6 pt-14 lg:px-8">
        <div className="mx-auto max-w-2xl py-32 sm:py-48 lg:py-56">
          <div className="text-center">
            <h1 className="text-4xl font-bold tracking-tight text-gray-900 sm:text-6xl">
              The largest verified database of healthcare providers
            </h1>
            <p className="mt-6 text-lg leading-8 text-gray-600">
              Access detailed information about doctors, nurses, and healthcare facilities across the United States. Perfect for medical device sales, pharmaceutical companies, and healthcare recruiters.
            </p>
          </div>
        </div>

        <div className="mx-auto mt-16 max-w-xl sm:mt-20">
          <iframe
            data-tally-src="https://tally.so/embed/w7EY0R?alignLeft=1&hideTitle=1&transparentBackground=1&dynamicHeight=1"
            loading="lazy"
            width="100%"
            height="364"
            frameBorder="0"
            marginHeight="0"
            marginWidth="0"
            title="MedicalProviderLeads"
            style={{ maxWidth: '100%', margin: '0 auto' }}
          ></iframe>
          <p className="mt-4 text-sm text-gray-500 text-center">
            Your card will not be charged until your 30-day trial has ended, and you can cancel + export your data any time before that.
          </p>
        </div>
      </div>
    </div>
  );
}

export default function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<LandingPage />} />
        <Route path="/pricing" element={<Pricing />} />
        <Route path="/error" element={<Error />} />
      </Routes>
    </Router>
  );
}

