  {
    name: 'Export & Connect',
    description: 'Export provider lists and connect with decision-makers through our platform.',
    icon: function ExportIcon(props) {
      return (
        <svg
          xmlns="http://www.w3.org/2000/svg"
          fill="none"
          viewBox="0 0 24 24"
          strokeWidth={1.5}
          stroke="currentColor"
          {...props}
        >
          <path
